import "./App.css";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

import MedicalLoginPage from ".MedicalLoginPage.jsx";
import MedicalRegistrationPage from ".MedicalRegistrationPage";
import ForgotPasswordPage from ".ForgotPasswordPage";
// import ContactUsPage from "./components/contect/ContactUsPage";
import Navbar from "./components/Navbar/Navbar";
import Home from "./components/Home/Home";
import Footer from "./components/Footer/Footer";
import Services from "./components/Services/Services";
import Frequency from "./components/Frequency/Frequency";

function App() {
  return (
    <Router>
      <Navbar />
      <Routes>
        <Route path="/home" element={<Home />} />
        <Route path="/services" element={<Services />} />
        <Route path="/" element={<MedicalLoginPage />} />
        <Route path="/registration" element={<MedicalRegistrationPage />} />
        <Route path="/forgot-password" element={<ForgotPasswordPage />} />
        {/* <Route path="/contact" element={<ContactUsPage />} /> */}
        <Route path="/Frequency" element={<Frequency />} />
      </Routes>
      <Footer />
    </Router>
  );
}

export default App;
